import logo from './logo.svg';
import './App.css';

function mainHeader() {
	return (
		<div className="header">
			<header className="App-header">
				<h1>Hello</h1>
			</header>
		</div>
	);
}


function App() {
  return (
    <div className="App">
	    <mainHeader/>

    </div>
  );
}

export default App;
